import React from 'react'
import { useSelector } from 'react-redux'

const Types = () => {
const types = useSelector((state) => state.types)

return (
    <select>
            <option>-</option>
            {
                types.map((t) => {
                    return (
                        <option value={t.name} key={t.id + t.name} >{t.name}</option>
                    )
                })
            }
    </select>
  )
}

export default Types
